script: |
  super -f text -I q13300.spq | sort > q13300.out

inputs:
  - name: q13300.spq
    data: |
      SELECT DISTINCT col0 FROM tab0 (FORMAT parquet) WHERE NOT ( + + ( - col0 ) ) + - + col2 IN ( - + 11 + - col0 - + col0 + col0 + + 87 * - col1 + + + col0 + + col0 * - 81 + - col2 * 19 / col2 );
  - name: tab0

outputs:
  - name: q13300.out
    data: |
      15
      87
      97
